import React from "react";

const CodeEditor = ({ transcript, generatedCode }) => {
  return (
    <div className="bg-gray-900 text-green-400 font-mono p-4 rounded h-[400px] overflow-y-auto">
      <pre>
        {generatedCode || "// Waiting for code...\n\n"}{/* fallback */}
      </pre>
    </div>
  );
};

export default CodeEditor;
